import { Route } from "react-router-dom";
import ALLMUPS from "./pages/ALLmeetups";
import Favorites from "./pages/Favorites";
import NewMeetupPage from "./pages/NewMeetup";
import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <div>
      <BrowserRouter>
      <Route path="/">
        <ALLMUPS />
      </Route>

      <Route path="/new">
        <NewMeetupPage />
      </Route>

      <Route path="/fav">
        <Favorites  />
      </Route>
      </BrowserRouter>
    </div>
  );
}

export default App;
